import React from 'react';
import '../assets/css/Home.css';
import { Container, Row, Col, Carousel } from 'react-bootstrap';
// import Logo from '../assets/statics/logo-principal.svg';
import Img1 from '../assets/statics/entrenamiento.jpg';
import Img2 from '../assets/statics/masculino.jpg';
import Img3 from '../assets/statics/femenino.jpg';
import Img4 from '../assets/statics/predio.jpg';
import { Link } from 'react-router-dom';

export default function Home() {
  return (
    <div className='home'>
      <Container>
        <Row className='first-section'>
          <Col md={12}>
            <Carousel className='carousel'>
                <Carousel.Item>
                  <img
                    className="d-block w-100 carousel-img"
                    src={Img1}
                    alt="First slide"
                  />
                  <Carousel.Caption>
                    <h1 className='carousel-title'>Entrená para competir</h1>
                  </Carousel.Caption>
                </Carousel.Item>
                <Carousel.Item>
                  <img
                    className="d-block w-100 carousel-img"
                    src={Img2}
                    alt="First slide"
                  />
                  <Carousel.Caption>
                    <h1 className='carousel-title'>Entrená para competir</h1>
                  </Carousel.Caption>
                </Carousel.Item>
              </Carousel>
          </Col>
          {/*
          <Col md={12}>
            <img src={Logo} alt='' className='home-logo'></img>
              <h3 className='home-txt'>Profesionalizando el fútbol amateur.</h3>
              <Link to={'https://wa.me/5491138609659'} target='_blank'>
                <button className='home-btn'>Sumate a GF</button>
              </Link>
          </Col>
          */}
         
        </Row>
        <Row>
          <Col xs={12} className='second-section'>
        
          </Col>
        </Row>
      </Container>
    </div>
  )
}
